import React ,{ useEffect, useState} from "react";
import axios from 'axios'

const DroneData = () => {
    fetch('https://assignments.reaktor.com/birdnest/drones', {
        method: 'GET',
    })
    .then(response => response.text())
    .then(text => console.log(text))
}

export default DroneData;
